  \"2016-08-02T20:54:33.340866\",\n\t\"name\": \"exposure-forecaster-a16a1\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Exposure Forecaster Database (ExpoCastDB)
  is EPA's database for aggregating chemical exposure information and can be used
  to help with chemical exposure predictions. The database currently includes biomonitoring
  exposure data from three studies: the American Healthy Homes Survey, the First National
  Environmental Health Survey of Child Care Centers and the Children's Total Exposure
  to Persistent Pesticides and Other Persistent Organic Pollutants study. Data include
  the amounts of chemicals found in food, drinking water, air, dust indoor surfaces
  and urine. The database will eventually include high-throughput exposure predictions
  for thousands of chemicals based on manufacture and use information. EPA researchers
  developed high-throughput exposure models to predict exposures for 1,763 chemicals
  using production volume, environmental fate and transport models, and a simple indicator
  of consumer product use.The model is being improved by adding more refined indoor
  and consumer use information since these are also large determinants of exposure.
  As these models are refined and more exposure data is collected, it will be added
  to ExpoCastDB.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
